style.css:
@-moz-document url-prefix("http://trainbit.com/"), url-prefix("http://www.trainbit.com/"), url-prefix("http://trainbit.com/files/#"), url-prefix("http://trainbit.com/pricing/") {

 @font-face {
      font-family: IRANSansWeb;
      src: url('http://mahditx.persiangig.com/IRANSansWeb.eot');
      src: url('http://mahditx.persiangig.com/IRANSansWeb.eot?#iefix') format('embedded-opentype'),
      	url('http://mahditx.persiangig.com/IRANSansWeb.woff') format('woff'),
      	url('http://mahditx.persiangig.com/IRANSansWeb.ttf') format('truetype');
     
  }

  body {
     font-family: 'IRANSansWeb';
  }
  .container {
      font-family: 'IRANSansWeb';
  }
  .container h5 {
      font-family: 'IRANSansWeb';
  }
  .container button {
      font-family: 'IRANSansWeb';
  }
  #header #menu li a {
      font-family: 'IRANSansWeb';
  }
  #header #lang {
      font-family: 'IRANSansWeb';
  }
  #header #navbar {
      font-family: 'IRANSansWeb';
  }
  #pricing-container .features-list tbody td {
      font-family: 'IRANSansWeb';
  }
  #pricing-container .features-list thead td .cost {
      font-family: 'IRANSansWeb';
  }
  #pricing-container .features-list tbody th {
      font-family: 'IRANSansWeb';
  }
  #files-container #upload-box .upload-title .title {
      font-family: 'IRANSansWeb';
  }
  #files-container #right-col #files-list li .fileinfo .filename a {
      font-family: 'IRANSansWeb';
  }
  .dialog-box > .dialog-title > .title {
      font-family: 'IRANSansWeb';
  }
  .button {
      font-family: 'IRANSansWeb';
  }
#files-container #right-col #files-list li.selected {
    background-color: #ffefb6;
}
#files-container #right-col #files-list li .fileinfo .filename {
    color: #ff5a00;
}
}
